INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 10021, 0.0, 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 1, 0.0, "カオリ（サマー）", 24015, 4, 24, 110501, "2030/12/17 14:59:59", "2019/07/31 12:00:00");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 10021, 4.0, 1, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 2, 0.0, "カオリ（サマー）", 24016, 4, 24, 110501, "2030/12/17 14:59:59", "2019/07/31 12:00:00");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 10021, 0.0, 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 3, 0.0, "カオリ（サマー）", 24017, 4, 24, 110501, "2030/12/17 14:59:59", "2019/07/31 12:00:00");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 10021, 5.2, 2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 4, 0.0, "カオリ（サマー）", 24018, 1, 24, 110501, "2030/12/17 14:59:59", "2019/07/31 12:00:00");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 10021, 4.2, 6, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5, 0.0, "カオリ（サマー）", 24019, 5, 24, 110501, "2030/12/17 14:59:59", "2019/07/31 12:00:00");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 10021, 0.0, 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 6, 0.0, "カオリ（サマー）", 24020, 2, 24, 110501, "2030/12/17 14:59:59", "2019/07/31 12:00:00");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 10021, 6.4, 6, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 7, 0.0, "カオリ（サマー）", 24021, 1, 24, 110501, "2030/12/17 14:59:59", "2019/07/31 12:00:00");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 10021, 0.0, 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 8, 0.0, "カオリ（サマー）", 24022, 2, 24, 110501, "2030/12/17 14:59:59", "2019/07/31 12:00:00");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 10021, 10.08, 3, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 9, 0.0, "カオリ（サマー）", 24023, 6, 24, 110501, "2030/12/17 14:59:59", "2019/07/31 12:00:00");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 10021, 5.0, 2, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10, 0.0, "カオリ（サマー）", 24024, 1, 24, 110501, "2030/12/17 14:59:59", "2019/07/31 12:00:00");
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (0.0, 10021, 0.0, 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 11, 0.0, "カオリ（サマー）", 24025, 2, 24, 110501, "2030/12/17 14:59:59", "2019/07/31 12:00:00");
